Dear Ms. Levi:

The Howard County Sheriff is in receipt of your correspondence dated February 28, 2023, requesting records pursuant to the Maryland Public Information Act (MPIA), Md. Code Ann., Gen. Prov. (“GP”) §§ 4-101 et seq.  In your correspondence you requested the following records related to the records for every sworn and civilian member of the Howard County Sheriff's Office for fiscal year 2022:

1. First and last name;
2. Unique sequence number;
3. Race;
4. Gender;
5. Hire date;
6. 2022 salary;
7. 2022 overtime

The Sheriff does have records responsive to all seven request.  Please see attachment.

Pursuant to GP § 4-362, you are entitled to seek judicial review of this decision. Alternatively, you may file a request for mediation with the Public Access Ombudsman and, if the Ombudsman is unable to resolve the matter, may subsequently seek a resolution from the Public Information Act Compliance Board for those matters within the Compliance Board’s jurisdiction. See GP §§ 4-1A-01 et seq. and 4-1B-01 et seq.

